import React, { useEffect, useState } from "react";
import Box from "@mui/material/Box";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TablePagination from "@mui/material/TablePagination";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import dayjs from "dayjs";
import { useSearchParams } from "react-router-dom";
import InputAdornment from "@mui/material/InputAdornment";
import ClearIcon from "@mui/icons-material/Clear";
import CircularProgress from "@mui/material/CircularProgress";
import {
  Button,
  FormControl,
  IconButton,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
} from "@mui/material";

import { getTableData } from "../CallApi/GetTableData";
import {
  alphabetically,
  getComparator,
  TableHeader,
} from "../Component/TableHeader";
import DatePickup from "../Component/DatePickup";

export default function TableData() {
  const [order, setOrder] = useState("");
  const [orderBy, setOrderBy] = useState("asc");
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const [loading, setLoading] = useState(false);

  const [resp, setResp] = useState([]);
  const [filteredArray, setFilteredData] = useState([]);

  const [searchParam, setsearchParam] = useSearchParams();

  ////for Search
  const [logId, setLogId] = useState("");
  const [appType, setAppType] = useState("");
  const [appId, setAppId] = useState("");
  const [actionType, setActionType] = useState("");
  const [from, setFrom] = useState("");
  const [to, setTo] = useState("");

  const applicationTypeList = [
    ...new Set(resp?.map((item) => item.applicationType)),
  ];

  const actionTypeList = [...new Set(resp?.map((item) => item.actionType))];

  const handleSort = (property) => {
    const isAsc = orderBy === property && order === "asc";
    setOrder(isAsc ? "desc" : "asc");
    setOrderBy(property);
  };

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  // const clearFilter = () => {
  //   setLogId("");
  //   setAppId("");
  //   setAppType("");
  //   setActionType("");
  //   setFrom("");
  //   setTo("");
  // };

  const applyFilter = () => {
    setPage(0);
    logId ? searchParam.set("logId", logId) : searchParam.delete("logId");
    appId ? searchParam.set("appId", appId) : searchParam.delete("appId");
    appType
      ? searchParam.set("appType", appType)
      : searchParam.delete("appType");
    actionType
      ? searchParam.set("actionType", actionType)
      : searchParam.delete("actionType");
    from ? searchParam.set("from", from) : searchParam.delete("from");
    to ? searchParam.set("to", to) : searchParam.delete("to");
    setsearchParam(searchParam);

    // (searchParam.get("logId") ||
    //   searchParam.get("appId") ||
    //   searchParam.get("appType") ||
    //   searchParam.get("actionType") ||
    //   searchParam.get("from") ||
    //   searchParam.get("to")) &&
    //   clearFilter();

    // console.log("val is ", appType, searchParam.get("appType"));

    let filteredData = [];
    filteredData = resp.filter((el) => {
      return (
        el.applicationType === appType ||
        el.logId === logId ||
        el?.logId.toString()?.includes(logId) ||
        el.applicationId === appId ||
        el?.applicationId?.toString()?.includes(appId) ||
        el.actionType === actionType ||
        (from &&
          !to &&
          dayjs(el.creationTimestamp).format("YYYY-MM-DD") ===
            dayjs(el.from).format("YYYY-MM-DD")) ||
        (!from &&
          to &&
          dayjs(el.creationTimestamp).format("YYYY-MM-DD") ===
            dayjs(el.to).format("YYYY-MM-DD")) ||
        (dayjs(el.creationTimestamp).format("YYYY-MM-DD") <=
          dayjs(el.to).format("YYYY-MM-DD") &&
